import React, { Component } from 'react';
import './app.css';
import AnchorLink from 'react-anchor-link-smooth-scroll';

class App extends Component {
  render() {
    return (
    <div>
    <AnchorLink href='#things'>Things</AnchorLink>
    <AnchorLink href='#stuff'>Stuff</AnchorLink>
 
    <section id='things'>
      <h2>Things</h2>
    </section>
    <section id='stuff'>
      <h2>Stuff</h2>
    </section>
    </div>
    )
  };
};

export default App;
